import React from 'react';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  }
}));



function Content() {
  const classes = useStyles();
  return (
    <div id="content">
      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs={6}>
            <Tab />
          </Grid>
          <Grid item xs={6}>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

export default Content;
